import React from 'react';
import '../styles/Manage.css';
import {MANAGE_PATH} from "../constants/routes";

class Manage extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            isLoading: true,
            email: '',
            userName: '',
            createDate: '',
            characterName: '',
        }
    };

    componentDidMount() {
        this.props.sendGetRequest(MANAGE_PATH)
            .then((response) => {
                console.log(response);
            }).catch((error) => {
                console.log("error");
                console.log(error.response);
        })
    }

    render() {

        return (
            <React.Fragment>
                XDXDXD
            </React.Fragment>
        );
    }
}

export default Manage;
